//About page Component

//Module import
import React, { Component } from 'react';

//Style import
import './About.css';

class About extends Component {
	constructor(props) {
		super(props);

		this.state = {};
	}
	render() {
		return (
			<div>
				<p>This is About</p>
			</div>
		);
	}
}

export default About;
